  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this study were: 1) Extend
  the previous amphibian and terrestrial mammal surveys to obtain more complete species
  lists and a greater range of seasonal data on species occurrence and abundance.
  2) Compile previous data on breeding and migratory data collected by Norm Famous
  in this region, and extend his studies on ANP and NSGA-WH lands to obtain more complete
  inventories of the landbird communities there. 3) Initiate new inventories of bats
  and bryophyte vegetation on these lands. 4) For each of the above animal and plant
  groups, identify federal and Maine-listed endangered or threatened species and species
  of management concern.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
